		return (
			<tr>
				<td>{props.children[key].employerName}</td>
				<td>{props.children[key].position}</td>
				<td>{props.children[key].startDate}</td>
				<td>{props.children[key].endDate}</td>
				<td>{props.children[key].description}</td>
			</tr>
		);
	});
